import { AnimateNumber } from './func'
import { Post } from './Post'

export function Posts(props) {

	return <div>
		{
			props.posts.map(post => (
				<Post key={post.id} name={post.name} />
			))


		}
		{

			props.count.map((el) => (
				<p>{AnimateNumber(el)}</p>
			))

		}
	</div>
}
